import Header from './core/components/common/Header/Header'
import Footer from './core/components/common/Footer/Footer'
import Filter from './core/components/home/filter/Filter'
import Type from './core/components/home/type/Type'
import Recent from './core/components/home/Recent/Recent'
import Location from './core/components/home/location/Location'

function App() {
  return (
    <>
        <Header/>
        <Filter/>
        <Type/>
        <Recent/>
        <Location/>
        <Footer/>
    </>
  );
}

export default App;
